class Solution:
    def maximumHappinessSum(self, happiness, k: int) -> int:
        list.sort(happiness,reverse=True)
        res=0
        for i in range(k):
            if(happiness[i]-i<0):
                break
            res+=(happiness[i]-i)
        return res
